var fs = require("fs")

export default function Gallery(props) {
  fs.readFile(props.galleryDirectory, 'utf8', function (err,data) {
	if (err) {
	  return console.log(err);
	}
	console.log(data);
  });

  return (
    <>Gallery shit</>
  )
}
